      <div>
        <NavBar isAuthenticated={isAuthenticated} /> {/* Passando isAuthenticated como propriedade */}
        <Container>
          <LoginCard>
            <h2>Login</h2>
            {isAuthenticated ? (
              // Conteúdo quando o usuário estiver autenticado
              <div>
                <button onClick={handleSignout}>Sign out</button>
              </div>
            ) : (
              // Conteúdo quando o usuário não estiver autenticado
              <div id="signInDiv"></div>
            )}
          </LoginCard>
        </Container>
        <Footer />
      </div>
    );
  };
  
